import React, { useEffect, useState } from "react";
import { api } from "../../api/api";


export default function IdososAcompanhados() {
    const [idosos, setIdosos] = useState([]);


    useEffect(() => {
        api.get('/familiares/idosos')
            .then(res => setIdosos(res.data))
            .catch(err => console.error(err));
    }, []);


    return (
        <div style={{ padding: 20 }}>
            <h3>Idosos Acompanhados</h3>
            <ul>
                {idosos.map(i => <li key={i.id}>{i.nome}</li>)}
            </ul>
        </div>
    );
}
